import React from "react";
import SelectField from "./SelectField";

const FlowBox = (props) => {

 

  const options = [
    { value: "option1", label: "Option 1" },
    { value: "option2", label: "Option 2" },
    { value: "option3", label: "Option 3" },
  ];
  return (
    <div  className="bg-white p-4 rounded-md max-w-md mx-auto shadow-lg border-b mt-10">
      <div className="px-8 py-8">{props.content}
        <SelectField label="Forward" name="forward" id={'forwardid' +props.content} widt  h="w-50" options={options} fieldfunction={props.fieldfunction}/>
        <SelectField label="Return" name="return" id={'returnid'+props.content} width="w-50" options={options} fieldfunction={props.fieldfunction}/>
      </div>
    </div>
  );
};

export default FlowBox;
